function stepChart(ctx, data, color) {
  return new Chart(ctx, {
    type: "line",
    data: { datasets: [{ data, borderColor: color, stepped: true, borderWidth: 1 }] },
    options: { ...commonOptions, scales: { ...commonOptions.scales, y: { ticks: { stepSize: 1 } } } }
  });
}

function lineChart(ctx, data, color) {
  return new Chart(ctx, {
    type: "line",
    data: { datasets: [{ data, borderColor: color, borderWidth: 1 }] },
    options: commonOptions
  });
}

const carrier = document.getElementById('carrier').getContext('2d');
const wan = document.getElementById('wan').getContext('2d');
const rsrp = document.getElementById('rsrp').getContext('2d');
const snr = document.getElementById('snr').getContext('2d');
stepChart(carrier, seg.carrier, '#1f78b4');
stepChart(wan, seg.wan, '#33a02c');
lineChart(rsrp, seg.rsrp, '#6a3d9a');
lineChart(snr, seg.snr, '#ff7f00');
[carrier.canvas, wan.canvas, rsrp.canvas, snr.canvas].forEach(c => c.height = 140);

</script>
</body></html>
